import {LuFileSymlink } from 'react-icons/lu';
import { IoBody } from "react-icons/io5";

import '../stylesheet/compsStyle/services.css';
export default function Services () {

    return (
        <>
        <div className='services-div'>
              <ul>
                <li>
                    <Link to=''>حساب العمر</Link>
                </li>
                <li>
                    <Link to=''>حساب النسبة الموزونة</Link>
                </li>
                <li>
                    <Link to=''>حساب السعرات الحرارية<br/><IoBody size={15}/></Link>
                </li>
                <li>
                    <Link to=''>تحويل الملفات<br/>(<LuFileSymlink size={15}/>)</Link>
                </li>
              </ul>
        </div>
        </>
    )
};
